    [],nt"num_tags": 0,nt"name": "current-direction-chemical-zooplankton-phytoplankton-and-other-data-from-moored-current-meter-cd1b9e",nt"isopen":
    false,nt"url": null,nt"notes": "Current direction, chemical, phytoplankton,
    zooplankton, and other data were collected using moored current meter casts and
    other instruments in the Gulf of Mexico from February 19, 1982 to March 23, 1983.
    Data were submitted by Texas A&M University as part of the Brine Disposal project.
    Data has been been processed by NODC to the NODC standard F005- Current Meter Data,
    F004- Water Physics and Chemistry, F028- Phytoplankton, F123 Fish Shellfish Resource,
    and F124- Zooplankton formats. Full format and format code descriptions are available
    at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThe F004 format is used
    for data from measurements and analyses of physical and chemical characteristics
    of the water column. Among chemical parameters that may be recorded are salinity,
    PH, and concentration of oxygen, ammonia, nitrate, phosphate, chlorophyll, and suspended
    solids. Physical parameters that may be recorded include temperature, density (sigma-t),
    transmissivity, and current velocity (east-west and north-south components). Cruise
    and station information, including environmental conditions of the study site at
    the time of observations, is also included.nnThe F005 format is used for time series
    measurements of ocean currents obtained using moored current-measuring instruments,
    principally Aanderaa current meters (manufactured by Aanderaa Instruments Inc.).
    These data represent the Eulerian method of current measurement, i.e., the meters
    are deployed at a fixed mooring point and measure flow past the sensor. Position,
    water depth, and sensor depth are reported for each station. The data record comprises
    values of current direction and speed at specified date and time. Data values may
    be subject to averaging or filtering and are typically reported at 10-15 minute
    time intervals. Other environmental parameters may also be reported. These include:
    water temperature, salinity, conductivity, and transmissivity; wind direction and
    speed; and dominant wave direction, height, and period. A text field is available
    for optional comments.nnThe F028 format is used for data from the sampling and analysis
    of marine phytoplankton. Information on phytoplankton abundance, distribution, and
    productivity derived from these data support studies of marine populations and ecosystems.
    Data reported may include: position, date, and time of sampling; bottom depth and
    sampling depths; volume of water filtered; and concentration of cells, carbon concentration,
    wet and dry weight, and counts for each species reported. Comments may be relayed
    in a text record.nnThe F123 format is used for data from field sampling of marine
    fish and shellfish. The data derive from analysis of midwater or bottom tow catches
    and provide information on population density and distribution. Cruise information,
    position, date, time, gear type, fishing distance and duration, and number of hauls
    are reported for each survey. Environmental data may include meteorological conditions,
    surface and bottom temperature and salinity, and current direction and speed. Bottom
    trawl or other gear dimensions and characteristics are also reported. Catch statistics
    (e.g., weight, volume, number of fish per unit volume) may be reported for both
    total haul and for individual species. Biological characteristics of selected specimens,
    predator/ prey information (from stomach contents analysis), and growth data may
    also be included. A text record is available for comments.nnThe F124 format is used
    for data from sampling and analysis of marine zooplankton. Information on zooplankton
    abundance, distribution, and productivity derived from these data support studies
    of marine populations and ecosystems. Data reported may include: cruise information,
    position, date, and time of sampling; bottom depth, sampling depths, temperature,
    and salinity; gear type, volume of water filtered, total dry and wet weight, and
    other data for total haul; and data for subsamples by species. Data on zooplankton
    catch by species may include subsample size, zooplankton concentration, life history
    code, and numbers of adults, juveniles, eggs, and larvae. Estimated density of holoplankton
    and meroplankton and data on ichthyoplankton may also be reported. A text record
    is available for comments. Note: there are two options for reporting subsample counts
    of individuals at different life history stages. If life history codes are used,
    only number of adults should be reported on that record. Additional separate records
    should then be used to report number of juveniles and so on. Alternatively, life
    history codes may not be used and number of adults, juveniles, and so entered in
    the proper fields of a single record.nnThe F132 format contains data from field
    sampling or surveys of bottom dwelling marine organisms. The data provide information
    on species abundance, distribution, and biomass; they may have been collected by
    point sampling (grab or core), by tow (dredge, trawl or net), by photographic surveys,
    or by other methods. Cruise information such as vessel, start and end dates, investigator,
    and institution/agency; station numbers, positions and times; and equipment and
    methods are reported for each survey. Environmental data reported at each sampling
    site may include meteorological and sea surface conditions; surface and bottom temperature,
    salinity and dissolved oxygen; and sediment characteristics. Number of individual
    organisms and total weight of organisms is reported for each species. A text record
    is available for comments.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
